import { Link } from "react-router-dom";

const HeaderBrandListing = ({ brands }) => {

    const setActiveBrandId = (brand) => {
        alert ('wtf');
    }

    return (
        <>
            <ul className="dropList active">
                {
                    brands.map((brand, key) => {
                        return <li key={key}><Link onClick={(brand) => setActiveBrandId()} className="headerBrandList">{brand.title}</Link></li>
                    })
                }
            </ul>
        </>
    )
}

export default HeaderBrandListing
